import React, { useState, useEffect } from "react";
import axios from "axios";
import { getAccessToken } from "../utils/authUtils";
import { getStompClient } from "../api/websocket"; // ‚úÖ WebSocket ÌÅ¥ÎùºÏù¥Ïñ∏Ìä∏ Í∞ÄÏ†∏Ïò§Í∏∞
import "../styles/Chatbox.css"; 

const Chatbox = ({ projectId }) => { // ‚úÖ ÌîÑÎ°úÏ†ùÌä∏ IDÎ•º propsÎ°ú Î∞õÏùå
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState("");

  // ‚úÖ Ï±ÑÌåÖ Î©îÏãúÏßÄ Î∂àÎü¨Ïò§Í∏∞ Ìï®Ïàò
  const fetchChatMessages = async () => {
    if (!projectId) {
      console.warn("‚ùå ÌîÑÎ°úÏ†ùÌä∏ IDÍ∞Ä Ï†ïÏùòÎêòÏßÄ ÏïäÏùå, Ï±ÑÌåÖ Î∂àÎü¨Ïò§ÏßÄ ÏïäÏùå.");
      return;
    }

    const token = getAccessToken();
    try {
      const response = await axios.get(`http://localhost:8082/api/chat/${projectId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setMessages(response.data);
      console.log("‚úÖ Ï±ÑÌåÖ Î©îÏãúÏßÄ Î°úÎìú ÏÑ±Í≥µ:", response.data);
    } catch (error) {
      console.error("‚ùå Ï±ÑÌåÖ Í∏∞Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error);
    }
  };

  // ‚úÖ ÌîÑÎ°úÏ†ùÌä∏Í∞Ä Î≥ÄÍ≤ΩÎê† Îïå WebSocket Íµ¨ÎèÖ Î∞è Í∏∞Ï°¥ Î©îÏãúÏßÄ Î∂àÎü¨Ïò§Í∏∞
  useEffect(() => {
    if (!projectId) return;

    console.log(`üîÑ ChatboxÏóêÏÑú Í∞êÏßÄÎêú ÌîÑÎ°úÏ†ùÌä∏ ID: ${projectId}`);
    fetchChatMessages(); // ‚úÖ Ï±ÑÌåÖ Í∏∞Î°ù Í∞ÄÏ†∏Ïò§Í∏∞

    const stompClient = getStompClient();

    if (!stompClient.connected) {
      console.warn("‚ö†Ô∏è WebSocketÏù¥ ÏïÑÏßÅ Ïó∞Í≤∞ÎêòÏßÄ ÏïäÏùå. ÌôúÏÑ±Ìôî ÏãúÎèÑ...");
      stompClient.activate();
    }

    // ‚úÖ Íµ¨ÎèÖ (Subscribe) ÏÑ§Ï†ï
    const subscription = stompClient.subscribe(`/topic/chat/${projectId}`, (message) => {
      const receivedMessage = JSON.parse(message.body);
      console.log("üì© ÏÉà Ï±ÑÌåÖ Î©îÏãúÏßÄ ÏàòÏã†:", receivedMessage);
      setMessages((prevMessages) => [...prevMessages, receivedMessage]); // ‚úÖ Î©îÏãúÏßÄ Ï∂îÍ∞Ä
    });

    return () => {
      console.log("üõë WebSocket Íµ¨ÎèÖ Ìï¥Ï†ú:", `/topic/chat/${projectId}`);
      subscription.unsubscribe();
    };
  }, [projectId]);

  // ‚úÖ Î©îÏãúÏßÄ Ï†ÑÏÜ° Ìï®Ïàò
  const sendMessage = async () => {
    if (!newMessage.trim() || !projectId) return;

    const token = getAccessToken();
    try {
      const messageData = {
        content: newMessage.trim(),
        sender: { email: localStorage.getItem("userEmail") }, // ‚úÖ ÌòÑÏû¨ Î°úÍ∑∏Ïù∏Ìïú ÏÇ¨Ïö©Ïûê Ïù¥Î©îÏùº Ï∂îÍ∞Ä
      };

      // ‚úÖ WebSocketÏùÑ ÌÜµÌï¥ Î©îÏãúÏßÄ Ï†ÑÏÜ°
      const stompClient = getStompClient();
      stompClient.publish({
        destination: `/app/chat/${projectId}`,
        body: JSON.stringify(messageData),
      });

      console.log("üì§ Î©îÏãúÏßÄ Ï†ÑÏÜ°:", messageData.content);
      setNewMessage(""); // ÏûÖÎ†• ÌïÑÎìú Ï¥àÍ∏∞Ìôî
    } catch (error) {
      console.error("‚ùå Î©îÏãúÏßÄ Ï†ÑÏÜ° Ïã§Ìå®:", error);
    }
  };

  return (
    <div className="chatbox-container">
      <h3>ÌåÄ Ï±ÑÌåÖ</h3>
      {projectId ? (
        <>
          <div className="messages">
            {messages.length > 0 ? (
              messages.map((msg, index) => (
                <p key={index}>
                  <strong>{msg.sender.username}</strong>: {msg.content}
                </p>
              ))
            ) : (
              <p>üì≠ ÏïÑÏßÅ Î©îÏãúÏßÄÍ∞Ä ÏóÜÏäµÎãàÎã§.</p>
            )}
          </div>
          <input
            type="text"
            value={newMessage}
            onChange={(e) => setNewMessage(e.target.value)}
            placeholder="Î©îÏãúÏßÄÎ•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî..."
          />
          <button onClick={sendMessage}>Ï†ÑÏÜ°</button>
        </>
      ) : (
        <p>üö® ÌîÑÎ°úÏ†ùÌä∏Î•º ÏÑ†ÌÉùÌï¥Ï£ºÏÑ∏Ïöî.</p> // ‚úÖ ÌîÑÎ°úÏ†ùÌä∏Í∞Ä ÏóÜÏùÑ Îïå ÏïàÎÇ¥ Î©îÏãúÏßÄ
      )}
    </div>
  );
};

export default Chatbox;
